import React from 'react';
import styles from './banner.module.css'
import { Parallax } from 'react-parallax';
const back= "https://images.unsplash.com/photo-1601411101851-ea0e07766235?ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&ixlib=rb-1.2.1&auto=format&fit=crop&w=800&q=80";


document.body.style.textAlign = "center";


function banner() {
    return (

        <Parallax        
            bgImage={back} strength={450}

        >

            <div className={styles.bg_container}>
                <p className={styles.bg_p}> "The Mechanic, wherever you are get some help" </p>
            </div>

        </Parallax>
    )
}

export default banner
